    background-color : #202020;
`;

const AppHeader = () => {
    return (
        <Row>
            <Col span={4}>LEFT</Col>
            <Col span={16}>
                <Input.Search placeholder="Search..." enterButton />
                CENTER
            </Col>
            <Col span={4}>RIGHT</Col>
        </Row>

    );
}

export default AppHeader;
